script: |
  super -f text -I q12009.spq | sort > q12009.out

inputs:
  - name: q12009.spq
    data: |
      SELECT DISTINCT - CAST ( NULL AS INTEGER ) + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col1 + - col2 * - col2 NOT IN ( - col0 / - col2 );
  - name: tab1

outputs:
  - name: q12009.out
    data: |
